import React from 'react'

export default function Task(props) {

    return (
        <tr>
            <th scope="row">1</th>
            <td>{props.taskDescription}</td>
            <td>{props.dueDate}</td>
            <td><button className='btn btn-primary mx3' onClick={editTask}>Edit</button></td>
            <td><button className='btn btn-primary mx3' onClick={deleteTask}>Delete</button></td>
        </tr>
    )
}
